  List<WishMessage> getMessages(String category) {
    return messagesByCategory[category] ?? [];
  }


  void toggleFavorite(WishMessage message) {
    message.isFavorite = !message.isFavorite;
    messagesByCategory.refresh();
    _saveFavorites();
  }


  void _saveFavorites() {
    final favTexts = <String>[];


    messagesByCategory.forEach((_, list) {
      for (var m in list) {
        if (m.isFavorite) favTexts.add(m.text);
      }
    });


    box.write('favorites', favTexts);
  }


  void _loadFavorites() {
    final favTexts = box.read<List>('favorites') ?? [];


    messagesByCategory.forEach((_, list) {
      for (var m in list) {
        m.isFavorite = favTexts.contains(m.text);
      }
    });
  }


  List<WishMessage> getFavoriteMessages() {
    final fav = <WishMessage>[];
    messagesByCategory.forEach((_, list) {
      fav.addAll(list.where((m) => m.isFavorite));
    });
    return fav;
  }
}